import { createAsyncThunk } from "@reduxjs/toolkit";
import { createUser, signIn } from "../../../utils/services";

export const setRegister = createAsyncThunk("auth/setRegister", async (token: any, { dispatch }) => {
    return createUser
})
export const login = createAsyncThunk("auth/login", async (token: any, { dispatch }) => {
    return signIn(token)
})
